import {Types} from '../actions/dow';

const INITIAL_STATE = {
    items: []
};

export default function dow(state = INITIAL_STATE, action) {
    switch (action.type) {
        case Types.GET_DOW_SUCCESS:{
          console.log('API success')
            return {
                ...state,
                items: action.payload
            }
        }
        default: {
            return state;
        }
    }
}
